          전체
        </label>
        <div id="circle1"></div>
        <input
          type="radio"
          value="2"
          id="typeMistake"
          checked={checked === "2"}
          onChange={handleChecked}
          onClick={filter}
        />
        <label htmlFor="typeMistake" className="type">
          mistake
        </label>
        <div id="circle2"></div>
        <input
          type="radio"
          value="3"
          id="typeBetter"
          checked={checked === "3"}
          onChange={handleChecked}
          onClick={filter}
        />
        <label htmlFor="typeBetter" className="type" id="typeBetter">
          better
