        <div id="circle3"></div>
        <input
          type="radio"
          value="4"
          id="typeUnsolved"
          checked={checked === "4"}
          onChange={handleChecked}
          onClick={filter}
        />
        <label htmlFor="typeUnsolved" className="type" id="typeUnsolved">
          unsolved
        </label>
        <div id="circle4"></div>
        <input
          type="radio"
          value="5"
          id="typeAgain"
          checked={checked === "5"}
          onChange={handleChecked}
          onClick={filter}
        />
        <label htmlFor="typeAgain" className="type" id="typeAgain">
          again
        </label>
        <div id="circle5"></div>
        <input
          type="radio"
          value="6"
          id="typeEtc"
          checked={checked === "6"}
          onChange={handleChecked}
          onClick={filter}
        />
        <label htmlFor="typeEtc" className="type" id="typeEtc">
          etc
        </label>

        <img id="sort" src="../../img/sort.png" width="20px" alt="sort"/>
